  \"National Wildlife Refuge System Protocol Framework for the Inventory and Monitoring
  of Secretive Marsh Birds\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:04:21.217307\",\n\t\"name\": \"national-wildlife-refuge-system-protocol-framework-for-the-inventory-and-monitoring-of-sec\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This survey protocol provides standardized
  methods for monitoring secretive marsh birds during the breeding season on National
  Wildlife Refuges across North America.  The standardized survey methods for marsh
  birds originated from suggestions during a workshop at Patuxent Wildlife Research
  Center (Ribic et al. 1999), and the methods were discussed and recommended for widespread
  use at a subsequent workshop at Patuxent (U.S. Fish and Wildlife Service 2006).
  The survey methods incorporate a 5-minute passive listening period followed by a
  series of 1-minute segments of call broadcasts to increase detection probability
  of focal marsh bird species. Several approaches that allow analysts to account for
  imperfect detection are provided. We include suggestions and guidance on probabilistic
  sampling designs and data analysis techniques to meet a variety of local and regional
  scale management objectives. Survey timing and associated costs will vary among
  refuges depending on logistics and the number and location of survey points.\",\n\t\"license_title\":
